love the stamps because they just transport me back to my childhood. They are quaint and just lovely and a joy to colour. I selected the gorgeous rabbit motif and a handful of blends, and spent some time mass producing multiple card toppers on Whisper White layers which I had die cut with my Rectangle Stitched Framelits Dies. When I finished I added some Pool Party Shimmer Ribbon and adhered to Crumb Cake card bases. Below is a little step by step of how I coloured my stamped images. Step 1 - I stamped my bunny in Tuxedo Black Memento Ink and then applied Dark Smokey Slate. Step 2 - I blended with my Bronze Blends Pen. Step 3 - I blended with Dark Crumb Cake. Step 4 - I added Light Crumb Cake and blended around the face, ears, feet and tummy. Step 5 - I added Dark Pool Party. Step 6 - I blended with Light Pool Party. Step 7 - I added Dark Petal Pink to the inner ears. Step 8 - Light Olive for the grassy patches. I had a whale of time creating this first batch of February cards. I think I shall be using another of the charming images for my next batch. Hope you like today's little project - or not so little project. It took a good few hours! Thanks for looking. Have a lovely rest of the weekend. Linda xx Product List Stampin' Trimmer [129722] 28.00 Stampin' Dimensionals [104430] 3.75 Paper Snips Scissors [103579] 9.25 Grid Paper [130148] 11.00 Whisper White A4 Thick Cardstock [140490] 7.25 Liquid Multipurpose Glue [110755] 3.75 Big Shot [143263] 102.00 Fable Friends Cling Stamp Set [148670] 20.00 Crumb Cake A4 Card Stock [121685] 8.00 Rectangle Stitched Framelits Dies [148551] 33.00 Crumb Cake Stampin' Blends Markers Combo Pack [144601] 8.50 Pool Party Stampin' Blends Markers Combo Pack [144605] 8.50 Bronze Stampin' Blends Marker [144607] 4.25 Smoky Slate Dark Stampin' Blends Marker [145055] 4.25 Dark Petal Pink Stampin' Blends Marker [146871] 4.25 Old Olive Light Stampin' Blends Marker [144574] 4.25 Pool Party 3/8\" Shimmer Ribbon [144152] 6.50 Tuxedo Black Memento
